" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Opening the parametrium during a radical hysterectomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 425px; height: 406px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
