"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10024155\">",
"      What are some side effects of this drug?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10024157\">",
"      What are some side effects that I need to call my doctor about right away?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10024152\">",
"      How is this drug best taken?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"outlineLink\" href=\"#F10024153\">",
"      What do I do if I miss a dose?",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
