"  <div class=\"figure\" style=\"width: 502px\">",
"   <div class=\"ttl\">",
"    Carotid artery surgery (endarterectomy)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 482px; height: 594px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    During carotid artery surgery, also called \"endarterectomy,\" the doctor clamps the carotid artery above and below the area that has plaque. Then the doctor cuts open the artery and removes the plaque. Next, he or she sews the artery back together and unclamps the artery.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: What To Expect During Carotid Endarterectomy. Diseases and Conditions Index. National Heart Lung and Blood Institute.",
