"    <a class=\"contributor contributor_credentials\" href=\"mobipreview.htm?33/45/34521/contributors\">",
"     Kathryn A Collins, MD, PhD, FACS",
"    </a>",
"    <br/>",
"   </div>",
"  </div>",
